import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
    border: 1px solid grey;
    border-radius: 5px;
    margin: 20px;
    padding:20px;
`

function Card({ item }) {
    return (
        <div>
            <div>{item.name}</div>
            <div>{item.raiting}</div>
            <div>{item.released}</div>
            <div>{item.name}</div>
        </div>
    )
}

export default Card
